// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Test{
    uint256 public constant MAX = ~uint256(0); //115_792_089_237_316_195_423_570_985_008_687_907_853_269_984_665_640_564_039_457_584_007_913_129_639_935
    uint256 public _tTotal = 5 * 10**6 * 10**18; // 5_000_000
    uint256 public _rTotal = (MAX - (MAX % _tTotal)); // 115792089237316195423570985008687907853269984665640560_000000_000000000000000000
    uint256 public rate = _rTotal / _tTotal;
    uint256 public qualityBase = 10000;


    function computeSeed(address user) internal view returns (uint256) {
        uint256 _now = block.timestamp;

        uint256 seed = uint256(
            keccak256(
                abi.encodePacked(
                    _now +
                        block.difficulty +
                        (uint256(keccak256(abi.encodePacked(block.coinbase))) /
                            _now) +
                        block.gaslimit +
                        (uint256(keccak256(abi.encodePacked(user))) / _now) +
                        block.number
                )
            )
        );
        return seed;
    }

    function percent() public view returns(uint256) {
        uint256 seed = computeSeed(msg.sender);
        uint256 quality = (seed % 100) * (200 - 100 + 1) + 10000;
        return quality;
    }

    function generate()
        public
        view
        returns(uint8 rarity, uint256 productivity)
    {
        uint256 seed = computeSeed(msg.sender);
        uint256 quality = seed % qualityBase;
        rarity = getRarity(quality);
        productivity = getProductivity(quality, rarity);
    }

    function getProductivity(uint256 _quality, uint8 _rarity)
        public
        view
        returns (uint256 unfold)
    {
        require(_rarity > 0 && _rarity <= 5, "invalid rarity");


        if (_rarity == 1) {
            unfold = _quality * (120 - 100 + 1) + 100000;
        } else if (_rarity == 2) {
            unfold = _quality * (140 - 120 + 1) + 120000;
        } else if (_rarity == 3) {
            unfold = _quality * (160 - 140 + 1) + 140000;
        } else if (_rarity == 4) {
            unfold =_quality * (180 - 160 + 1) + 160000;
        } else if (_rarity == 5) {
            unfold = _quality * (200 - 180 + 1) + 180000;
        }
        // if (_rarity == 1) {
        //     unfold = (_quality * 20000) / 5000;
        //     return unfold + 100000;
        // } else if (_rarity == 2) {
        //     unfold = ((_quality - 5000) * 20000) / 3000;
        //     return unfold + 120000;
        // } else if (_rarity == 3) {
        //     unfold = ((_quality - 8000) * 20000) / 1500;
        //     return unfold + 140000;
        // } else if (_rarity == 4) {
        //     unfold = ((_quality - 9500) * 20000) / 400;
        //     return unfold + 160000;
        // } else if (_rarity == 5) {
        //     unfold = ((_quality - 9900) * 20000) / 100;
        //     return unfold + 180000;
        // }
    }

    function getRarity(uint256 quality) public view returns (uint8) {
        if (quality < (qualityBase * 500) / 1000) {
            return 1;
        } else if (
            (qualityBase * 500) / 1000 <= quality &&
            quality < (qualityBase * 800) / 1000
        ) {
            return 2;
        } else if (
            (qualityBase * 800) / 1000 <= quality &&
            quality < (qualityBase * 950) / 1000
        ) {
            return 3;
        } else if (
            (qualityBase * 950) / 1000 <= quality &&
            quality < (qualityBase * 990) / 1000
        ) {
            return 4;
        } else {
            return 5;
        }
    }

}

